import React from 'react'
import './ImageShow.css'

class ImageShow extends React.Component{
    render(){
        return (
           <div style={{ backgroundImage: "url(/portfolio-covers/print1.jpg)" }}>>
               <p>ola mundo</p>
               <img src="portfolio-covers/print1.jpg" className="container"></img>
           </div>
        )
    }
}

export default ImageShow
